  ?leader a dbo:Politician .
  ?admin a dbo:Organisation ;
         dbo:leader ?leader .
}

SELECT ?successor WHERE {
  <http://dbpedia.org/resource/Ercole_II_d'Este> dbo:successor ?successor .
}

SELECT ?artist WHERE {
  <http://dbpedia.org/resource/Cecil_Taylor> dbo:associatedBand ?artist .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/resource/>

SELECT ?spouse WHERE {
  dbp:Prince_Louis_of_Battenberg dbo:spouse ?spouse .
}

SELECT ?awardee WHERE {
  ?award a dbo:Award .
  ?award dbo:recipient ?awardee .
  ?award dbo:awardName "Oleksandr Syrskyi" .
}

SELECT ?event WHERE {
  ?event a dbo:Event ;
         dbo:relatedTo dbr:Francisco_Largo_Caballero ;
         (a dbo:MilitaryConflict ; a dbo:SocietalEvent).
}

SELECT ?governor WHERE {
  <http://dbpedia.org/resource/Dana_Murphy> dbo:governor ?governor .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?spouseOfSpouse WHERE {
  dbr:Princess_Victoria_of_Hesse_and_by_Rhine dbo:spouse ?firstSpouse .
  ?firstSpouse dbo:spouse ?spouseOfSpouse .
}

SELECT ?artist ?associatedArtist WHERE {
  { 
    ?person dbo:birthName "Paul Laurence Dunbar Chambers Jr." .
    ?person dbo:associatedBand ?associatedArtist .
    ?person a dbo:MusicalArtist .
  }
  UNION
  { 
    ?billEvans dbo:birthName "Bill Evans" .
    ?billEvans dbo:associatedBand ?associatedArtist .
    ?billEvans a dbo:MusicalArtist .
  }
}

SELECT ?coach WHERE {
  <http://dbpedia.org/resource/Iran_national_football_team> dbo:coach ?coach .
}

SELECT ?country WHERE {
  ?country dbo:administeredBy dbr:Madrid .
  ?country a dbo:Country .
}

SELECT ?landmark WHERE {
  ?landmark a dbo:Landmark .
  ?landmark dbo:elevation 28 .
}

SELECT ?member ?party WHERE {
  { ?member dbo:party dbr:Democratic-Republican_Party. }
  UNION
  { ?member dbo:party dbr:Federalist_Party. }
}

SELECT ?birthName WHERE {
  <http://dbpedia.org/resource/George_Mountbatten,_2nd_Marquess_of_Milford_Haven> dbo:birthName ?birthName .
}

SELECT ?birthplace WHERE {
  ?person a dbo:Politician .
  ?person dbo:birthPlace ?birthplace .
  ?person dbo:award dbr:Renata_Adler .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?spouse WHERE {
  dbr:Princess_Caroline-Mathilde_of_Denmark dbo:spouse ?spouse .
  dbr:Alexandrine_of_Mecklenburg-Schwerin dbo:child dbr:Christian_X_of_Denmark .
}

SELECT ?person ?award WHERE {
  { 
    ?person dbo:award dbr:Volunteer_Decoration .
    ?person dbo:militaryCampaign dbr:New_Guinea_campaign .
  } UNION {
    ?person dbo:award dbr:Medal_bar .
  }
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?birthplace ?town ?soccerClub WHERE {
  ?manager a dbo:SportsManager ;
           dbo:team dbr:Kedah_FA ;
           dbo:birthPlace ?birthplace .

  ?birthplace dbo:country dbr:Brazil ;
              rdf:type dbo:Place ;
              rdfs:label ?town .

  ?manager dbo:team ?soccerClub .

  FILTER (lang(?town) = "en")
}

SELECT ?noblePerson WHERE {
  ?noblePerson dbo:birthName "George Mountbatten" .
  ?noblePerson a dbo:Noble .
}

SELECT ?property ?value WHERE {
  <http://dbpedia.org/resource/Kevin_Russell_(musician)> ?property ?value.
}
